import React from 'react';
import ImgContact from 'src/assets/contact.png';

import {
  Container,
  ContentContainer,
  TitleContainer,
  ImageContact,
  ContainerContact,
} from './styles';

const Contact: React.FC = () => {
  return (
    <Container>
      <TitleContainer>Contact</TitleContainer>
      <ContentContainer>
        <ImageContact src={ImgContact} />
        <TitleHome>
          Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam
          laoreet, erat eu pulvinar tempor.
        </TitleHome>
        <ParagraphHome>
          Ut mauris libero, gravida nec leo sit amet, aliquam dictum nisl. In
          viverra, sem at blandit commodo, massa eros accumsan dolor, eget
          malesuada elit ligula et dui. Aliquam eget augue in tortor interdum
          commodo ac et ante. Ut a molestie diam. Fusce eu quam tristique,
          tempus nunc non, mollis odio. Aenean molestie cursus vehicula. Duis a
          blandit urna. Nullam porta, lorem non elementum laoreet, magna nisl
          pulvinar justo, eu posuere eros dui quis ipsum. Sed condimentum
          suscipit porta. Nam eu nunc consequat, volutpat libero sed, pharetra
          nulla. Cras nisl libero, lobortis non bibendum at, posuere a augue.
        </ParagraphHome>
      </ContentContainer>
    </Container>
  );
};

export default Contact;
